  of the Northern Half of the Backscatter Intensity Mosaic of the Sea Floor off Northeastern
  Cape Cod from USGS Cruise 98015 (CAPENORTHMOS_GEO4M_WGS84.TIF, Geographic, WGS84)\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 17,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-12-23T02:44:23.093144\",\n\t\"name\": \"capenorthmos-geo4m-wgs84-tif-4-m-image-of-the-northern-half-of-the-backscatter-intensity-mosai\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set includes backscatter intensity
  of the sea floor offshore of northern Cape Cod, Massachusetts. The data were collected
  with a multibeam sea floor mapping system during USGS survey 98015, conducted November
  9 - 25, 1998. The surveys were conducted using a Simrad EM 1000 multibeam echo sounder
  mounted aboard the Canadian Coast Guard vessel Frederick G. Creed. This multibeam
  system utilizes 60 electronically aimed receive beams spaced at intervals of 2.5
  degrees that insonify a strip of sea floor up to 7.5 times the water depth (swath
  width of 100 to 200 m within the survey area). The horizontal resolution of the
  beam on the sea floor is approximately 10% of the water depth. Vertical resolution
  is approximately 1 percent of the water depth. With backscatter intensity, the intensity
  of the acoustic return from the sea floor from the multibeam system, is a function
  of the properties of the surficial sediments and of the bottom roughness. Generally,
  a strong return (light gray tones) is associated with rock or coarse-grained sediment,
  and a weak return (dark gray tones) with fine-grained sediments. However, the micro-topography,
  such as ripples, burrows, and benthic populations also affect the reflectivity of
  the sea floor. Direct observations, using bottom photography or video, and surface
  samples, are needed to verify interpretations of the backscatter intensity data.
  The backscatter data have a weak striping that runs parallel to the ship's track.
  Some of the striping is the result of poor data return at nadir that appears as
  evenly-spaced thin speckled lines. Some striping is also due to critical angle effects,
  where the intensity of return varies as a function of the angle of incidence of
  the incoming sound on the seafloor (Hughes-Clark and others, 1997).\",\n\t\"license_title\":
